----------------------------------------------------------------
-- Tabelle Preis
-----------------------------------------------------------------
DROP TABLE preis;
CREATE TABLE preis
("P_NR" NUMBER(2) NOT NULL, "P_TN1" NUMBER(6, 2) NOT NULL,
"P_TN2" NUMBER(6, 2) NOT NULL, "P_TN3" NUMBER(6, 2) NOT NULL,
"P_TN4" NUMBER(6, 2) NOT NULL, "P_TN5" NUMBER(6, 2) NOT NULL,
 PRIMARY KEY("P_NR"), 
 CHECK(P_TN1>P_TN2),
 CHECK(P_TN2>P_TN3),
 CHECK(P_TN3>P_TN4), 
 CHECK(P_TN4>P_TN5))  
 TABLESPACE "STUDENTEN";
