-- Tabelle Kurs
--
DROP TABLE kurs;
CREATE TABLE kurs
("K_NR" NUMBER(7) NOT NULL,
 "K_BEREICH"   VARCHAR2(30) NOT NULL,
 "K_TITEL" VARCHAR2(30) NOT NULL, 
 "K_UNTERTITEL" VARCHAR2(40) NOT NULL,
 "K_DAUER" NUMBER(1) NOT NULL, 
 "P_NR" NUMBER(2) NOT NULL,
 "K_VORKENNTNISSE" VARCHAR2(150) NOT NULL,
 "K_ZIELGRUPPE" VARCHAR2(50) NOT NULL,
 "K_THEMEN" VARCHAR2(600) NOT NULL,
  PRIMARY KEY("K_NR"),
  FOREIGN KEY("P_NR")
    REFERENCES preis("P_NR"),   
    CHECK(K_Dauer>0))  
    TABLESPACE "STUDENTEN";
-----------------------------------------------------------------
-- Daten Tabelle Kurs
--

