--Tabelle Termin
--
DROP TABLE termin;
CREATE TABLE termin
("T_NR" NUMBER(4) NOT NULL,
 "K_NR" NUMBER(7) NOT NULL,
 "T_BEGINN" DATE NOT NULL,
 "T_ENDE" DATE  NOT NULL,
 "T_ORT" VARCHAR2(20) NOT NULL,
 PRIMARY KEY("T_NR"),
 FOREIGN KEY("K_NR") 
    REFERENCES kurs("K_NR"), CHECK(T_Beginn<=T_Ende))  
    TABLESPACE "STUDENTEN";
