-- Tabelle Themenverteilung
DROP TABLE themenverteilung;
CREATE TABLE themenverteilung
("TH_NR" NUMBER(4) NOT NULL,
 "D_NR" NUMBER(4) NOT NULL,
 "K_NR" NUMBER(7) NOT NULL, 
 "TH_TAGESSATZ" NUMBER(6, 2) NOT NULL,
 PRIMARY KEY("TH_NR"), 
 FOREIGN KEY("D_NR") 
  REFERENCES dozent("D_NR"),
 FOREIGN KEY("K_NR") 
  REFERENCES kurs("K_NR"))  
 TABLESPACE "STUDENTEN";

