-- Tabelle Buchung
DROP TABLE buchung;
CREATE TABLE buchung (
 "B_NR" NUMBER( 6 ) NOT NULL ,
 "TN_NR" NUMBER( 4 ) ,
 "T_NR" NUMBER( 4 ) ,
 "B_DATUM" DATE,
 "B_TZAHL" NUMBER(1),
 "B_PREIS" NUMBER( 10, 2 ) ,
 "B_NRANMELDER" NUMBER( 5 ) ,
 "B_STORNODATUM" DATE,
 "B_STORNOGEBUEHR" NUMBER(10,2),
  PRIMARY KEY ( "B_NR" ),
  FOREIGN KEY("TN_NR") 
  REFERENCES teilnehmer("TN_NR"),
  FOREIGN KEY("T_NR") 
  REFERENCES termin("T_NR"))
 TABLESPACE "STUDENTEN";

